export declare type File = {
    buffer: string;
    file_name: string;
    type: string;
    file_type: string;
    executable: boolean;
};
export declare type FetchPolicy = 'fetchOnError' | 'fetchOnSuccess' | 'fetchOnSuccessOrFailure';
export declare type OutputRequestObject = {
    file_path: string;
    fetchPolicy: FetchPolicy;
};
export declare type OutputFile = {
    file_path: string;
    buffer: string;
};
export declare type Task = {
    files: File[];
    cmd: string;
    task_id: string;
    frequency: number;
    outputRequestObjects?: OutputRequestObject[];
};
export declare type LogPayload = {
    task_id: string;
    log: string;
};
export declare type MessagePayload = {
    task_id: string;
    success: boolean;
    message?: string;
    code?: number;
    outputFiles?: OutputFile[];
};
export declare type AnalyticsPayload = {
    headers: string;
    metricsData: string;
};
export declare type AnalyticsAlertsData = {
    headers: string;
    alertsData: string;
};
export declare type AnalyticsLogPayload = {
    headers: string;
    logData: string;
};
export declare type Payload = LogPayload | MessagePayload | AnalyticsPayload | AnalyticsAlertsData | AnalyticsLogPayload;
export declare type MessageToServer = {
    Action: string;
    Payload: Payload;
};
export declare type MessageFromServer = {
    Action: string;
    Payload: Task[];
};
